      meetingTimeRef[index] = null;
      m_Data.data.duration.dayType = dayType;
      m_Data.data.duration.index = index;
      m_Data.data.duration.timeStatus = timeStatus;

      _self.startTimer(meetingArray[index]);

      return timeStatus;
