    FindlySDK.prototype.designFaqWithMappings = function (faqs, mapping) {
      // console.log("faqs", "mapping", faqs, mapping);
      var data = [];
      if ((faqs || []).length && mapping && Object.values(mapping).length) {
        faqs.forEach(faq => {
          var item = {};
          if (faq[mapping.heading]) {
            item.heading = faq[mapping.heading];
          }
          if (faq[mapping.description]) {
            item.description = faq[mapping.description];
          }
          if (faq[mapping.img]) {
            item.img = faq[mapping.img];
          }
          if (faq[mapping.url]) {
            item.url = faq[mapping.url];
          }
          if (!item.heading || !item.heading.toString().length) {
            item.heading = '';
          }
          if (!item.description || !item.description.toString().length) {
            item.description = '';
          }
          if (!item.img || !item.img.length) {
            item.img = '';
          }
          if (!item.url || !item.url.length) {
            item.url = '';
          }
          item.config = faq.config;
          item.feedback = faq.feedback;
          item.customization = null;
          item.sys_content_type = faq.sys_content_type;
          item.contentId = faq.contentId;
          item.addedResult = (faq.addedResult || (faq.addedResult == false)) ? faq.addedResult : false;
          item.bestMatch = (faq.bestMatch || (faq.bestMatch == false)) ? faq.bestMatch : false;
          data.push(item);
        });
        return data;
      }
    }

